import React from "react";
import { Helmet } from "react-helmet";
import Banner from "../components/Banner/Banner";
import Coinstable from "../components/Coinstable";

const Home = () => {
  return (
    <>
     <Helmet>
      <title></title>
     </Helmet>
      <Banner />
      <Coinstable />
    </>
  );
};

export default Home;
